function sleep(e){return new Promise(t=>setTimeout(t,e))}async function typewriteAdd(e,t){const o=[100,154,113,167,200,184];t.innerText="";for(const n of e)t.textContent+=n,await sleep(o[Math.floor(Math.random()*o.length)]||100)}async function typewriteRemove(e,t){for(const o of e)t.textContent=t.textContent.slice(0,-1),await sleep(100)}window.onload=(async()=>{writeUrl()});const writeUrl=async e=>{const t=["quotes/random","quotes/all","characters/all","characters/:id","episodes/","episodes/:id"],o=document.querySelector("pre strong");let n=0;for(;;)await typewriteAdd(t[n],o),await sleep(1e3),await typewriteRemove(t[n],o),await sleep(1e3),n=Math.floor(Math.random()*t.length)};